const Requirements = () => {
    return ( 
        <div className = 'requirements'>
            <h1>Requirements</h1>
            <div className = 'requirements-list'>
                <ul>
                <li><h5>Admission letter (six photocopies)</h5></li><br/>
                <li><h5>Birth certificate</h5></li><br/>
                <li><h5>Jamb change of course/institution (six photocopies)</h5></li><br/>
                <li><h5>Jamb result slip  (six photocopies)</h5></li><br/>
                <li><h5>Student receipt (six photocopies)</h5></li><br/>
                <li><h5>WAEC result (six photocopies)</h5></li><br/>
                <li><h5>Minimum of eight (8) passport photographs</h5></li><br/>
                </ul>            
            </div>
        </div>
        
    );
}
 
export default Requirements;
